import { NgModule, CUSTOM_ELEMENTS_SCHEMA } from '@angular/core';
import { RouterModule } from '@angular/router';
import { AutoCompleteModule } from 'primeng/autocomplete';
import { CalendarModule } from 'primeng/calendar';
import { SharedModule } from 'app/shared/shared.module';
import { CodeTypeService } from '../code-type';
import { DatePipe } from '@angular/common';

import { CodeManageComponent, CodeDeleteDialogComponent, codeRoute, codePopupRoute, CodeService } from './';

const ENTITY_STATES = [...codeRoute, ...codePopupRoute];

@NgModule({
  imports: [SharedModule, AutoCompleteModule, CalendarModule, RouterModule.forChild(ENTITY_STATES)],
  declarations: [CodeManageComponent, CodeDeleteDialogComponent],
  entryComponents: [CodeManageComponent, CodeDeleteDialogComponent],
  providers: [CodeService, CodeTypeService, DatePipe],
  schemas: [CUSTOM_ELEMENTS_SCHEMA],
})
export class CodeModule {}
